      pragma pg
      SELECT ALL + cor0.col0 + cor0.col0 * 30 AS col2 FROM tab1 AS cor0 GROUP BY cor0.col0, col2;
  - name: tab1

outputs:
  - name: q333.out
    data: |
      2542
      682
      868
